// src/MainApp.js
import React, { useEffect, useState } from 'react';

function MainApp() {
  const [texts, setTexts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filterSection, setFilterSection] = useState('');
  const [filteredTexts, setFilteredTexts] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/texts')
      .then(res => res.json())
      .then(data => {
        setTexts(data);
        setFilteredTexts(data);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  const parseMapString = (mapString) => {
    const cleanedString = mapString.trim().replace(/^\{|\}$/g, '');
    const regex = /(\w+)=((?:[^=,]|=(?!\w+=))+)/g;
    const obj = {};
    let match;
    while ((match = regex.exec(cleanedString)) !== null) {
      const key = match[1];
      const value = match[2].trim();
      obj[key] = value;
    }
    return obj;
  };

  const [showClearButton, setShowClearButton] = useState(false); // Show or hide clear data base button

  const handleFilter = () => {
    if (!filterSection) {
      setFilteredTexts(texts);
      return;
    }
    const filtered = texts.filter(({ content }) => {
      const data = parseMapString(content);
      return data.seccion === filterSection;
    });
    setFilteredTexts(filtered);
  };

  const handleClearFilter = () => {
    setFilterSection('');
    setFilteredTexts(texts);
  };

  const handleClearDatabase = () => {
    if (!window.confirm('Are you sure you want to clear the database? This action cannot be undone.')) return;
    fetch('http://localhost:3000/texts', { method: 'DELETE' })
      .then(res => {
        if (res.ok) {
          setTexts([]);
          setFilteredTexts([]);
          alert('Database cleared!');
        } else {
          alert('Failed to clear database');
        }
      })
      .catch(() => alert('Error clearing database'));
  };

  return (
    <div style={{ padding: 20 }}>
      <h1>Info scaneada</h1>
      <div style={{ marginBottom: 20 }}>
        <input
          type="text"
          placeholder="Filtrar por sección"
          value={filterSection}
          onChange={(e) => setFilterSection(e.target.value)}
          style={{ marginRight: 8 }}
        />
        <button onClick={handleFilter} style={{ marginRight: 8 }}>Filtrar</button>
        <button onClick={handleClearFilter} style={{ marginRight: 16 }}>Limpiar filtro</button>
        {showClearButton && (
          <button onClick={handleClearDatabase} style={{ backgroundColor: 'red', color: 'white' }}>
            Clear Database
          </button>
        )}
      </div>
      {loading && <p>Loading...</p>}
      {!loading && filteredTexts.length === 0 && <p>No texts found.</p>}
      <table border="1" cellPadding="8" cellSpacing="0" style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>Nombre</th>
            <th>Domicilio</th>
            <th>Teléfono</th>
            <th>Sección</th>
            <th>Referencia</th>
            <th>Creado por</th>
          </tr>
        </thead>
        <tbody>
          {filteredTexts.map(({ id, content }) => {
            const data = parseMapString(content);
            return (
              <tr key={id}>
                <td>{data.nombre || 'N/A'}</td>
                <td>{data.domicilio || 'N/A'}</td>
                <td>{data.telefono || 'N/A'}</td>
                <td>{data.seccion || 'N/A'}</td>
                <td>{data.referencia || 'N/A'}</td>
                <td>{data.creadopor || 'N/A'}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default MainApp;
